The American television comedy The Office was renewed by NBC for a seventh season on March 5, 2010. The season premiered on September 23, 2010 and will air on Thursdays at 9:00 p.m. ET as part of Comedy Night Done Right.On June 28, 2010, it was confirmed that the seventh season will be Steve Carell's last on the show, as his contract expires. NBC plans on continuing the series after his departure, and would welcome any return appearances by Carell. Actor and writer/co-executive producer B. J. Novak has renewed his contract with Universal Media Studios through an eighth season and will be promoted to full executive producer halfway through the seventh season. As of this season, Zach Woods, who plays Gabe Lewis on the show, has been promoted to a series regular. Executive producer/writer/actor Paul Lieberstein has confirmed that Amy Ryan, who portrays Holly Flax, will appear in eight episodes of the season. He also confirmed Kathy Bates will return as Jo Bennett in the season premiere. Melora Hardin, who portrays Jan Levinson, has announced on her Twitter account that she will return this season. Timothy Olyphant will guest star in at least two episodes as a rival salesman. It is also revealed that Pam dated Olyphant's character while Jim dated Karen. Holly will return to Dunder Mifflin in the hour-long Christmas episode that will be written by Mindy Kaling and directed by Rainn Wilson.
The seventh season of the show is produced by Reveille Productions and Deedle-Dee Productions, both in association with Universal Media Studios. The show is based upon theseries created by Ricky Gervais and Stephen Merchant, both of whom are executive producers on both the US and UK versions. The Office is produced by Greg Daniels, who is also an executive producer. Returning writers from the previous season include Mindy Kaling, B. J. Novak, Paul Lieberstein, Brent Forrester, Justin Spitzer, Aaron Shure, Charlie Grandy, Daniel Chun, Warren Lieberstein, and Halsted Sullivan. New writers in the seventh season include Peter Ocko, Jon Vitti, Steve Hely, and Carrie Kemper (sister of Ellie Kemper). Lieberstein serves as executive producer and showrunner. Kaling, Novak, Shure, Chun and Ocko are co-executive producers; Forrester and Vitti are consulting producers; Spitzer and Grandy are supervising producers; and Warren Lieberstein, Halsted Sullivan and Steve Hely are producers.

